import React from 'react'
import "./Videoes.css"
import Filter from '../Filter/Filter';
import SingleVideo from '../SingleVideo/SingleVideo';

const Videoes = () => {
    const videoJson = [
        {
            thumb_img:"https://i.ytimg.com/vi/6nxrllqnP2Q/hqdefault.jpg?sqp=-oaymwEcCOADEI4CSFXyq4qpAw4IARUAAIhCGAFwAcABBg==&rs=AOn4CLDYY4Hh0PZHPve2czR4CF0B4GdDiQ",
            profile__img:"https://yt3.ggpht.com/ytc/AKedOLSXFtwGeL6H6MQhblFqQyJHHVSWpJPAPRqja1foWg=s88-c-k-c0x00ffffff-no-rj",
            title:"Chauffeur: Official Music Video | Diljit Dosanjh x Tory Lanez | Ikky",
            channel__name:"Daljit Dosanjh",
            views:"18k views",
            timestamps:"2 months ago",
            video__duration:"1:03:23"
        },
        {
            thumb_img:"https://i.ytimg.com/vi/6nxrllqnP2Q/hqdefault.jpg?sqp=-oaymwEcCOADEI4CSFXyq4qpAw4IARUAAIhCGAFwAcABBg==&rs=AOn4CLDYY4Hh0PZHPve2czR4CF0B4GdDiQ",
            profile__img:"https://yt3.ggpht.com/ytc/AKedOLSXFtwGeL6H6MQhblFqQyJHHVSWpJPAPRqja1foWg=s88-c-k-c0x00ffffff-no-rj",
            title:"Chauffeur: Official Music Video | Diljit Dosanjh x Tory Lanez | Ikky",
            channel__name:"Daljit Dosanjh",
            views:"18k views",
            timestamps:"2 months ago",
            video__duration:"1:03:23"
        }
    ]
  return (
    <div className='Videoes'>
        <Filter />
        <div className='row'>
            {
                videoJson.map((item, key)=>{
                    return (
                        <SingleVideo 
                            thumb_img={item.thumb_img}
                            profile__img={item.profile__img}
                            title={item.title}
                            channel__name={item.channel__name}
                            views={item.views}
                            timestamps={item.timestamps}
                            video__duration={item.video__duration}
                            key={key}
                        />
                    )
                })
            }
            
            </div>
    </div>
  )
}

export default Videoes
